import React from 'react';
import { MdDeleteOutline } from "react-icons/md";


export default function History(props) {

    return (
      <div className="history-section">
        {props.history.map((oprt, index) => {
          return (
            <div className="history-div" key={index}>
              <div className="history-result">{oprt.re}</div>
              <div className="history-operation">{oprt.op}</div>
            </div>
          );
        })}
        <button>
          <MdDeleteOutline values={ {className : ''}} />
          {/* 
            1-add trash icon 
            2-add also a history button with hisory icon in body to toggle the history div
            
          */}
        </button>
      </div>
    );
}
